import { apiClient } from "./BaseUrl"

export const authenticateApi = (token) => apiClient.get(`/basicAuth`, {
    headers:
            {Authorization : token }
})
export const authenticateWithGoogle = () => "https://accounts.google.com/o/oauth2/v2/auth/oauthchooseaccount?response_type=code&client_id=1295533999-ctv3ruqb3223iica06kpm80p75bevmri.apps.googleusercontent.com&scope=openid%20profile%20email&state=BQD09v8e9nF01s37lGklYZiuWf0idlU1efUZ6RCrwTc%3D&redirect_uri=http%3A%2F%2Flocalhost%3A8080%2Flogin%2Foauth2%2Fcode%2Fgoogle&nonce=T9_MEZ69EICABiy-uNKKUTSM_J4BEQwmg_fkREqOHAQ&service=lso&o2v=2&ddm=0&flowName=GeneralOAuthFlow"

export const authenticateJWTApi = (username, password) => apiClient.post(`/authenticate`,{username,password})
